INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('18', 'Автомагазин \"Миля\" осуществляет прямые поставки контрактных автозапчастей из Японии. \r\nА так же прямую доставку из Японии автомобилей, половинок авто, катеров, водных мотоциклов.\r\n\r\nВНИМАНИЕ!!!\r\n\r\nКУЗОВНЫЕ детали, ОПТИКА, ЭЛЕКТРИКА возврату не подлежат!\r\n\r\nХОДОВАЯ часть, ДВС, АКПП, МКПП обмену либо возврату подлежит ТОЛЬКО если товар ненадлежащего качества.\r\n\r\nВремя на проверку и установку 4-10 дней с момента получения.\r\n\r\nОсуществляем  доставку до указанных вами ТК,  ЕСЛИ вы не указали ТК то отправляем по своему усмотрению.\r\nСтоимость доставки до ТК зависит от удаленности и габаритам товара.\r\nМинимальная стоимость 300р\r\n\r\n\r\n\r\nПЕРЕВОД на карту Сбербанка 4276 5000 2322 2548\r\nКондалова Ирина Викторовна. срок действия карты 03/19\r\n\r\nпросьба при переводе не указывать назначение платежа(только ФИО)\r\nОТ ВАС ГОРОД, ФИО, НОМЕР ТЕЛЕФОНА, СЕРИЯ И НОМЕР ПАСПОРТА ПОЛУЧАТЕЛЯ\r\nПОЖАЛУЙСТА, УВЕДОМИТЕ НАС О ПЕРЕВОДЕ СРЕДСТВ, ПРИЛОЖИВ ЧЕК В ЭЛЕКТРОННОМ ВИДЕ\r\n\r\n', '13', 'Миля', 'Контрактные запчасти: автостекла, двигатели и навесное оборудование, детали кузова, оптика, расходники, товары для тюнинга, ходовая часть', '1', '4', '', 'пр-кт 100-летия Владивостока, 12 стр. 4', 'a:1:{i:1;a:2:{s:5:\"email\";s:19:\"infomilya@gmail.com\";s:9:\"confirmed\";s:1:\"1\";}}', '8,18', '5.0', '1', '1', '', '1', 'a:17:{i:1;a:3:{s:4:\"file\";s:14:\"8-o-d-b-20.jpg\";s:4:\"name\";s:22:\"Миля фото (20)\";s:7:\"display\";s:1:\"1\";}i:2;a:3:{s:4:\"file\";s:14:\"8-o-d-b-17.jpg\";s:4:\"name\";s:22:\"Миля фото (17)\";s:7:\"display\";s:1:\"1\";}i:3;a:3:{s:4:\"file\";s:14:\"8-o-d-b-19.j