INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('201', 'Ассортимент компании включает все категории автозапчастей: двигатели в сборе и по частям, детали кузова, оптику, лобовые и другие стекла, ноускаты (передние части автомобилей), бамперы, мосты, рессоры, радиаторы, карданы, передние подвески, навесное электрооборудование, и многое другое. Все эти запасные части \"контрактные\", т.е. получены от разукомплектации автомобилей, не имеющих пробега по России. Этим обуславливается приличного уровня качество при сравнительно невысоких ценах. Также в настоящее время в наличии имеются большой выбор запчастей для многих марок японских легковых автомобилей. Кроме того на складе находятся контрактные и новые автозапчасти для микроавтобусов, минивэнов, джипов. Если говорить о автомобилях, для которых мы предлагаем запчасти, то среди них значаться как самые популярные, так и редкие, как выпускаемые в настоящее время, так и выпуск которых уже давно прекращен модели Toyota, Nissan, Honda, Mitsubishi, Mazda, Suzuki, Subaru, Isuzu, Daihatsu. Поставки контрактных автозапчастей из Японии осуществляются ежемесячно. Также компания higashi-parts принимает заявки на поставку из Японии контрактных запчастей б/у и новых. Можем предложить услуги по организации отправок в регионы и по Хабаровскому краю. География уже осуществленных поставок охватывает практически все регионы России. Большинство клиентов становятся нашими постоянными покупателями.', '197', 'Higashi-Parts', 'Higashi-Parts', '3', '16', '', 'ул. Аксёнова, 15 (р-н 11 гор. больницы)', 'a:1:{i:1;a:2:{s:5:\"email\";s:21:\"higashi-parts@mail.ru\";s:9:\"confirmed\";s:1:\"1\";}}', '8,15,18,9,10', '0.0', '1', '1'