INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('395', 'Магазин Корея Центр Запчасти в наличии для корейских автомобилей: Hyundai, KIA, Daewoo, SsangYong, Chevrolet. Фильтра: масленые, воздушные, салонные, топливные. Колодки: дисковые, барабанные, ручника. Щётки стеклоочистителя: летние, зимние, бескаркасные. Ремни: клиновые, поликлиновые и т. д. Запчасти для двигателя: вкладыши, кольца, прокладки, клапана, ролики, валы, маслосъемные колпачки, шестерни, термостаты, сальники, головки блока, помпы, ремкомплекты, опоры, радиаторы и т.д. Детали трансмиссионной системы автомобиля: диски и корзины сцепления, крестовины, выжимные подшипники, фильтра АКПП. Электрооборудование: датчики, предохранители, реле, лампы ближнего и дальнего света,свечи, провода, катушки зажигания, аккумуляторы. Детали ходовой части автомобиля: пыльники, ступичные подшипники, втулки, шаровые опоры, стойки стабилизатора, рычаги подвески, рулевые наконечники, тяги, стойки, амортизаторы, шрусы, диски колесные, колпаки, гайки, шпильки, шланги тормозные, диски тормозные. Детали выпускной и впускной системы: гофры, трубы глушителя, прокладки, подвесы глушителя. Кузовные запчасти: бамперы, крылья, капоты, двери, крышки багажника, защиты, подкрылки, зеркала. Оптика: фары, задние фонари, указатели поворота. Стекла: лобовые, задние, боковые. Аксессуары: эмблемы, хром накладки, ковры, дефлектора окон, дефлектора капота (мухобойки), утеплители ДВС.', '434', 'Корея - Центр', 'Корея - Центр', '19', '37', '57k.png', 'ул. Малахова, 94Б\r\nул. Целинная, 1Б корп. 2', 'a:1:{i:1;a:2:{s:5:\"email\";s:18:\"koreacentr@mail.ru\";s:9:\"confirmed\";s:1:\"1\";}}', '8,18,19', '0.0', '1', '1', 'http://kc