INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('348', 'В каталоге интернет-магазина авторазбора от компании Автовыбор 96 представлены запчасти на авто бу для всех пользующихся спросом в регионе легковых автомобилей. Здесь вы без труда подберете кузовщину, оптику, лобовые и дверные стекла, все, что требуется для ремонта КПП, трансмиссии, двигателя, аксессуары в салон и на кузов и многое другое. Основными конкурентными преимуществами сайта являются высокое качество поставляемых деталей с авторазбора и их доступная стоимость. Запчасти с разобранных автомобилей стоят намного дешевле, чем новые в розничных специализированных магазинах, а по качеству они порой превышают штамповку на частных производствах. Все разбираемые детали тщательно тестируются, проверяются на прочность и надежность и только потом поступают в продажу. По желанию заказчика возможна бесплатная доставка до Екатеринбурга или Челябинска, а при особо крупном заказе до самого места назначения. Все товары магазина сопровождаются официальной гарантией от специалистов авторазбора компании. Осуществляется продажа бу автозапчастей в любое время суток, без перерывов на выходные и праздничные дни. Это еще одно немаловажное преимущество интернет магазина. Заказчику не надо подстраиваться под часы работы магазина, можно посвятить этому удобное для себя время.', '367', 'Автовыбор96', 'Автовыбор96', '7', '21', '75f108c0413d0ecdf1be4edcdd0e61e734026478fdf2d26a001d51a725bbdf06-8o.jpg', 'ул. Чайковкого, д. 14', 'a:1:{i:1;a:2:{s:5:\"email\";s:19:\"avtovibor96@mail.ru\";s:9:\"confirmed\";s:1:\"1\";}}', '8,15,18', '0.0', '1', '1', 'avtovibor96.ru', '1', 'a:48:{i:1;a:3:{s:4:\"file\";s:81:\"0-02-01-0f