INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('379', 'ВНИМАНИЕ! Приобретая контрактные автозапчасти, следует помнить, что они являются бывшими в употреблении, не имеют гарантийного срока, не подлежат возврату и обмену на аналогичный товар (постановление Правительства РФ от 19 января 1998 г. №55 в ред. Постановлений Правительства РФ от 20.10.1998 № 1222, от 06.02.2002 № 81).\r\n\r\nВНИМАНИЕ!!! ПОКУПАТЕЛЬ самостоятельно выбирает транспортную компанию из тех, которые представлены в нашем городе - Ратэк, Энергия, КИТ, ДЕЛОВЫЕ ЛИНИИ , ПЭК , Желдорэкспедиция , и дополнительные требования к перевозке (обрешетка, страхование, внутренний пересчет) В случае, если транспортная компания не указана и дополнительные требования к перевозке не определены Вами - оставляем за собой право самостоятельного выбора, без права предъявления претензий по данному поводу с Вашей стороны. \r\n\r\nКОНТРАКТНЫЕ ЗАПЧАСТИ НА ПРЯМУЮ ИЗ ЯПОНИИ .\r\nУ нас в наличии на складе в Чите огромный выбор ДВС ,КПП ,ноускаты , телевизоры ,оптика ,капоты ,крылья ,двери ,стекла , бампера , элементы подвески , стартера ,ступицы ,трамблеры , мосты ,полуоси ,стойки ,радиаторы охлаждения и кондиционера и многое другое. Установка запчастей производится на нашем СТО, поэтому вы гарантировано купите исправную деталь. \r\n\r\nРАБОТАЕМ С РЕГИОНАМИ ! ДЛЯ РЕГИОНОВ ОПЛАТА НА КАРТУ СБЕРБАНКА 100% ,\r\n4276 **** **** 9418 , ОБЯЗАТЕЛЬНО УТОЧНЯЙТЕ НАЛИЧИЕ ! ДОСТАВКА ДО ТРАНСПОРТНОЙ КОМПАНИИ 300 - 800 р (в зависимости от объема и массы товара).\r\nПОЖАЛУЙСТА , УЧИТЫВАЙТЕ РАЗНИЦУ ВО ВРЕМЕНИ.', '408', 'ШЭЛДС', 'ШЭЛДС', '17', '34', 'shelds-logo.jpg', 'ул. Володарского, д. 30', 'a:1:{i:1;a:2:{s:5:\"email\";s