INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('563', 'Компания \"AUTO GLOBAL JP\" осуществляет оптовую и розничную продажу запчастей на любые марки японских автомобилей. Всегда в наличии более 20000 наименований запчастей (двигатели, акпп, ходовая часть, детали оптики и кузовные детали, электрооборудование и т.д). Также наша компания осуществляет отправку контейнеров (резина, автозапчасти), распилов, половинок, полетных бортов. Имеем прямой выход на любые аукционы Японии, что позволяет без посредников покупать любую технику по всей стране восходящего солнца, что в свою очередь экономит Ваше время и деньги. Более подробную информацию можно получить на сайте компании www.autoglobaljp.com. Осуществляем организацию отправок по всей территории РФ транспортными компаниями Энергия, Деловые линии, Ратэк, Пэк, Кит, Желдор Альянс, Желдор Экспедиция и другими, которые находятся на территории города Владивостока. Срок поставки запчастей составляет от 3 до 18 дней в зависимости от нахождения населенного пункта, в который идет груз. В нашем магазине можно оплатить товар любым удобным для Вас способом: - безналичный расчет -наличный расчет -перевод на карту сбербанка -перевод на карту сбербанка через ONLINE -оплата банковской картой через POS-терминал Заказать интересующую Вас автозапчасть можно, написав на электронный адрес AUTOGLOBALJP@LIST.RU или позвонив по телефону в офис компании. Работаем понедельник-пятница с 9.00 до 18.00, суббота с 10.00 до 16.00. Воскресенье выходной.', '619', 'AutoGlobal JP', 'AutoGlobal JP', '1', '4', 'autoglobaljp-logo.jpg', 'ул. Маковского, д. 56', 'a:1:{i:1;a:2:{s:5:\"email\";s:20:\"autoglobaljp@list.ru\";s:9:\"confirmed\"