INSERT INTO client.user_company1 (id, previev, usert, name, description, region, city, logo, address, emails, services, rating, subscribe_product, subscribe_request, site, subscribe_review, photos, coordinates, coordinates_search, dizlike, liket, sp1, sp2, sp3, sp4, sp5, sp6, sp7, sp8, sp9, sp10, sp11, sp12, phones_new, schedule_new, bank_details, credit_cards, info) VALUES ('831', 'Мы, одна из крупных компаний в Челябинске по продаже контрактных запчастей из Японии\r\n\r\nНа рынке авто запчастей без пробега по РФ более 7 лет. Предлагаем Вам приобрести запчасти из наличия, а также работаем под заказ (поставщики по всей России, срок исполнения заказа от 3-х дней)\r\n\r\nВ наличии тысячи деталей, имеющих малые пробеги и большой ресурс. В среднем пробег авто, поступившего к нам на склад от 40-80т.км\r\n\r\nА именно, мы предлагаем:\r\n\r\n-Двигатели (с документами таможни, нет проблем с оформлением в ГИБДД)\r\n-КПП (АКПП, Вариаторы, МКПП)\r\n-Навесное оборудование (генераторы, стартеры, насос ГУР, катушки, форсунки и т.д)\r\n-Кузовные детали (ноускаты, бампера, крылья, капоты, двери и т.д.)\r\n-Ходовая часть (стойки, рулевые рейки, рычаги, ступицы, диски тормозные, суппорта и т.д)\r\n-Электрика (датчики, переключатели, моторчики печки, блоки управления и т.д.)\r\n\r\n \r\n5 причин работать с нами:\r\n\r\n- подход к каждому клиенту\r\n- помощь в подборе автозапчастей\r\n- гарантия на детали\r\n- запчасти в наличии\r\n- низкая цена за качественные детали\r\n\r\nДействует система скидок для постоянных клиентов', '922', 'Autohelp (контрактные запчасти из Японии)', 'АвтоХелп', '4', '17', 'logo.png', 'Западный 2-й проезд, 6 (заезд с ул. Автодорожная). Находимся на территории Уральского дроболитейного завода.', 'a:2:{i:1;a:2:{s:5:\"email\";s:19:\"a.sadovnik@amh74.ru\";s:9:\"confirmed\";s:1:\"1\";}i:2;a:2:{s:5:\"email\";s:23:\"Autozakaz_2009@mail.ru \";s:9:\"confirmed\";s:1:\"0\";}}', '8,15', '0.0', '1', '1', 'www.amh74.ru', '1', '', '(55.20990176608257, 61.37103951901099)', 'Ч